import Nav from './Nav';
import LInk from 'next/link';

const Header = () => (
    <div>
        <div className="bar">
            <h1>
                <a href="">Sick Fits</a>
            </h1>
            <Nav />
        </div>
        <div className="sub-bar">
            <p>Search</p>
        </div>
        <div>Cart</div>
    </div>
);

export default Header;
